import React from 'react';

import login from './login';
import SignUp from './SignUp';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack'; 
import { useSelector, useDispatch } from 'react-redux';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();

const tabHomeNavigation = () => {
	const { isAuthenticated } = useSelector((state) => state.auth);

	return (
		<Tab.Navigator
			tabBarOptions={{
				style: {
					paddingVertical: 3,
					backgroundColor: '#03a9f4'
				},
				inactiveTintColor: '#bbb',
				activeTintColor: '#fff',
				labelStyle: {
					fontSize: 14
				}
			}}
		>
			<Tab.Screen
				options={{
					tabBarIcon: ({ color }) => <MaterialIcons name="directions-car" size={24} color={color} />
				}}
				name="Carros"
				component={List}
			/>
			{isAuthenticated && (
				<Tab.Screen
					options={{
						tabBarIcon: ({ color }) => <MaterialIcons name="add" size={24} color={color} />
					}}
					name="Adicionar"
					component={Add}
				/>
			)}
			<Tab.Screen
				options={{
					tabBarIcon: ({ color }) => <MaterialIcons name="account-circle" size={24} color={color} />
				}}
				name="Login"
				component={Login}
			/>
			<Tab.Screen
				options={{
					tabBarIcon: ({ color }) => (
						<View>
							<MaterialIcons name="add-shopping-cart" size={24} color={color} />
							<Bagde />
						</View>
					)
				}}
				name="Carrinho"
				component={Cart}
			/>
		</Tab.Navigator>
	);
};

function App() {

  const { isAuthenticated } = useSelector((state) => state.auth);

  return (
    <NavigationContainer>
      <Stack.Navigator>
        <React.Fragment>
          {!isAuthenticated && <Stack.Screen name="Login" component={login} />}
        </React.Fragment>
        <React.Fragment>
          {isAuthenticated && <Stack.Screen name="SignUp" component={SignUp} />}
        </React.Fragment>
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
